import React from "react";
import Sidebar from "./Sidebar";
import Topbar from "./Topbar";
import "../App.css";

const Layout = ({ children }) => {
  return (
    <React.Fragment>
      <div className="App container flex items-center justify-center rounded-md m-2 bg-slate-400 overflow-hidden ">
          <Sidebar />
          <main className="container">
            <Topbar />
            {children}
          </main>
        </div>
    </React.Fragment>
  );
};

export default Layout;
